#include <queue>
#include <bits/stdc++.h>

#include <stdio.h>
#include <vector>
using namespace std;

vector<int> intersperse(vector<int> numbers, int delimeter) { 
    vector<int> result; // Create a result vector
    int n = numbers.size(); // Get the size of the input vector

    // If the input vector is empty, return an empty vector
    if (n == 0) {
        return result;
    }

    // Iterate through the input vector
    for (int i = 0; i < n; i++) {
        result.push_back(numbers[i]); // Add the current element to the result
        // If it's not the last element, add the delimiter
        if (i < n - 1) {
            result.push_back(delimeter);
        }
    }

    return result; // Return the result vector
}

