    int n = numbers.size();

    // Step 1: Calculate the mean
    for (float num : numbers) {
        sum += num;
    }
    float mean = sum / n;

    // Step 2: Calculate the sum of absolute deviations
    float mad_sum = 0.0;
    for (float num : numbers) {
        mad_sum += fabs(num - mean);
    }

    // Step 3: Calculate the Mean Absolute Deviation
    float mad = mad_sum / n;
    return mad;
}

