vector<int> rolling_max(vector<int> numbers) {
    vector<int> rollingMax;
    int currentMax = INT_MIN; // Initialize to the smallest integer

    for (int number : numbers) {
        if (number > currentMax) {
            currentMax = number; // Update currentMax if the current number is greater
        }
        rollingMax.push_back(currentMax); // Append the current maximum to the result
    }

    return rollingMax; // Return the vector of rolling maximums
}

