vector<int> factorize(int n) {
    vector<int> result;
    // Check for factors from 2 to sqrt(n)
    for (int i = 2; i <= sqrt(n); i++) {
        // While i divides n, add i to result and divide n
        while (n % i == 0) {
            result.push_back(i);
            n /= i;
        }
    }
    // If n is still greater than 1, it is a prime factor
    if (n > 1) {
        result.push_back(n);
    }
    return result;
}

