double find_zero(vector<double> xs) {
    double low = -1000.0;
    double high = 1000.0;
    double mid;
    double tolerance = 1e-7; // Define a tolerance for convergence

    // Ensure that the function changes sign over the interval
    while (poly(xs, low) * poly(xs, high) > 0) {
        low -= 1000; // Expand the interval if necessary
        high += 1000;
    }

    // Bisection method
    while (high - low > tolerance) {
        mid = (low + high) / 2.0;
        if (poly(xs, mid) == 0) {
            return mid; // Found exact zero
        } else if (poly(xs, low) * poly(xs, mid) < 0) {
            high = mid; // Root is in the left half
        } else {
            low = mid; // Root is in the right half
        }
    }

    return (low + high) / 2.0; // Return the midpoint as the root
}

