double poly_derivative(vector<double> xs, double x) {
    double sum = 0;
    for (int i = 1; i < xs.size(); i++) {
        sum += i * xs[i] * pow(x, i - 1);
    }
    return sum;
}

double find_zero(vector<double> xs) {
    double x = 0; // Initial guess
    double tolerance = 1e-7; // Tolerance for convergence
    double fx, dfx;

    while (true) {
        fx = poly(xs, x);
        dfx = poly_derivative(xs, x);

        if (fabs(fx) < tolerance) {
            break; // Found a root
        }

        if (dfx == 0) {
            throw runtime_error("Derivative is zero, no solution found.");
        }

        x = x - fx / dfx; // Newton-Raphson update
    }

    return x;
}

