// Function to check if a number is prime
bool is_prime(int num) {
    if (num <= 1) return false;
    if (num <= 3) return true;
    if (num % 2 == 0 || num % 3 == 0) return false;
    for (int i = 5; i * i <= num; i += 6) {
        if (num % i == 0 || num % (i + 2) == 0) return false;
    }
    return true;
}

// Function to find the n-th Fibonacci prime
int prime_fib(int n) {
    int fib1 = 0, fib2 = 1;
    int count = 0;
    vector<int> fib_primes;

    while (count < n) {
        int fib_next = fib1 + fib2;
        fib1 = fib2;
        fib2 = fib_next;

        if (is_prime(fib_next)) {
            fib_primes.push_back(fib_next);
            count++;
        }
    }

    return fib_primes.back(); // Return the n-th Fibonacci prime
}

