using namespace std;

bool triples_sum_to_zero(vector<int> l) {
    sort(l.begin(), l.end()); // Step 1: Sort the vector
    int n = l.size();

    for (int i = 0; i < n - 2; i++) { // Step 2: Iterate through the vector
        int left = i + 1; // Initialize left pointer
        int right = n - 1; // Initialize right pointer

        while (left < right) { // Step 3: Use two pointers
            int sum = l[i] + l[left] + l[right];
            if (sum == 0) {
                return true; // Found a triplet
            } else if (sum < 0) {
                left++; // Move left pointer to the right
            } else {
                right--; // Move right pointer to the left
            }
        }
    }
    return false; // No triplet found
}

