int fib(int n) {
    if (n == 0) return 0;
    if (n == 1) return 1;

    int a = 0; // fib(0)
    int b = 1; // fib(1)

    for (int i = 2; i <= n; i++) {
        int c = a + b; // fib(i) = fib(i-1) + fib(i-2)
        a = b;         // move to the next Fibonacci number
        b = c;         // update b to the current Fibonacci number
    }

    return b; // b now holds fib(n)
}

