bool monotonic(vector<float> l) {
    if (l.size() <= 1) {
        return true; // A single element or empty vector is considered monotonic
    }

    bool isIncreasing = true;
    bool isDecreasing = true;

    for (size_t i = 0; i < l.size() - 1; i++) {
        if (l[i] < l[i + 1]) {
            isDecreasing = false; // Found an increasing pair
        }
        if (l[i] > l[i + 1]) {
            isIncreasing = false; // Found a decreasing pair
        }
    }

    return isIncreasing || isDecreasing; // Return true if either condition holds
}

