#include <stdio.h>
#include <cmath>
using namespace std;

int largest_prime_factor(int n) {
    int largest_factor = 1;

    // Check for number of 2s that divide n
    while (n % 2 == 0) {
        largest_factor = 2;
        n = n / 2;
    }

    // n must be odd at this point, check for odd factors from 3 to sqrt(n)
    for (int i = 3; i <= sqrt(n); i += 2) {
        while (n % i == 0) {
            largest_factor = i;
            n = n / i;
        }
    }

    // If n is still greater than 2, then n itself is prime
    if (n > 2) {
        largest_factor = n;
    }

    return largest_factor;
}

