bool will_it_fly(vector<int> q, int w) {
    // Check if the vector is empty
    if (q.empty()) {
        return false;
    }

    // Calculate the sum of elements in the vector
    int sum = accumulate(q.begin(), q.end(), 0);

    // Check if the sum exceeds the maximum weight
    if (sum > w) {
        return false;
    }

    // Check if the vector is a palindrome
    int n = q.size();
    for (int i = 0; i < n / 2; i++) {
        if (q[i] != q[n - 1 - i]) {
            return false;
        }
    }

    // If both conditions are satisfied, return true
    return true;
}

