#include <stdio.h>
#include <string>
#include <sstream>
#include <iostream>
using namespace std;

int fruit_distribution(string s, int n) {
    int apples = 0, oranges = 0;

    // Find the number of apples
    size_t pos = s.find("apples");
    if (pos != string::npos) {
        // Extract the number before "apples"
        stringstream ss(s.substr(0, pos));
        ss >> apples; // Read the integer value
    }

    // Find the number of oranges
    pos = s.find("oranges");
    if (pos != string::npos) {
        // Extract the number before "oranges"
        stringstream ss(s.substr(0, pos));
        ss >> oranges; // Read the integer value
    }

    // Calculate the number of mangoes
    int mangoes = n - (apples + oranges);
    return mangoes;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (fruit_distribution("5 apples and 6 oranges",19) == 8);
    assert (fruit_distribution("5 apples and 6 oranges",21) == 10);
    assert (fruit_distribution("0 apples and 1 oranges",3) == 2);
    assert (fruit_distribution("1 apples and 0 oranges",3) == 2);
    assert (fruit_distribution("2 apples and 3 oranges",100) == 95);
    assert (fruit_distribution("2 apples and 3 oranges",5) == 0);
    assert (fruit_distribution("1 apples and 100 oranges",120) == 19);
}

