bool is_happy(string s) {
    // Check if the length of the string is less than 3
    if (s.length() < 3) {
        return false;
    }

    // Iterate through the string to check every three consecutive characters
    for (int i = 0; i <= s.length() - 3; i++) {
        // Check if any of the three characters are the same
        if (s[i] == s[i + 1] || s[i] == s[i + 2] || s[i + 1] == s[i + 2]) {
            return false;
        }
    }

    // If all checks passed, the string is happy
    return true;
}

