bool prime_length(string str) {
    int length = str.length();

    // Check if length is less than 2
    if (length < 2) {
        return false;
    }

    // Check for factors from 2 to sqrt(length)
    for (int i = 2; i <= sqrt(length); i++) {
        if (length % i == 0) {
            return false; // Not a prime number
        }
    }

    return true; // It is a prime number
}

