#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <vector>
#include <climits>
#include <cstring>
#include <iostream>
#include <cassert>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <stdio.h>
#include <string>
#include <bitset>
using namespace std;

string solve(int N) {
    int sum_of_digits = 0;

    // Calculate the sum of digits
    while (N > 0) {
        sum_of_digits += N % 10; // Add the last digit
        N /= 10; // Remove the last digit
    }

    // Convert the sum of digits to binary
    return std::bitset<32>(sum_of_digits).to_string().substr(32 - (sum_of_digits ? (int)log2(sum_of_digits) + 1 : 1));
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (solve(1000) == "1");
    assert (solve(150) == "110");
    assert (solve(147) == "1100");
    assert (solve(333) == "1001");
    assert (solve(963) == "10010");
}

