vector<vector<int>> get_row(vector<vector<int>> lst, int x) {
    vector<vector<int>> result;

    // Iterate through each row
    for (int i = 0; i < lst.size(); i++) {
        // Iterate through each column in the current row
        for (int j = 0; j < lst[i].size(); j++) {
            // Check if the current element is equal to x
            if (lst[i][j] == x) {
                // Store the coordinates
                result.push_back({i, j});
            }
        }
    }

    // Sort the result by row index ascending and column index descending
    sort(result.begin(), result.end(), [](const vector<int>& a, const vector<int>& b) {
        if (a[0] == b[0]) {
            return a[1] > b[1]; // Sort by column index descending if rows are equal
        }
        return a[0] < b[0]; // Sort by row index ascending
    });

    return result;
}

