int is_bored(string S) {
    int boredomCount = 0;
    // Replace delimiters with a space to split sentences easily
    for (char& c : S) {
        if (c == '.' || c == '?' || c == '!') {
            c = ' ';
        }
    }

    // Use stringstream to split the string into sentences
    stringstream ss(S);
    string sentence;

    while (getline(ss, sentence, ' ')) {
