        sentence.erase(0, sentence.find_first_not_of(" \t\n\r"));

        // Check if the sentence starts with "I"
        if (sentence.rfind("I", 0) == 0) { // rfind checks if "I" is at index 0
            boredomCount++;
        }
    }

    return boredomCount;
}

