#include <stdio.h>
#include <string>
#include <cctype> // for isspace
using namespace std;

int is_bored(string S) {
    int count = 0;
    size_t start = 0;
    size_t end;

    while (start < S.length()) {
        // Find the next delimiter
        end = S.find_first_of(".!?", start);

        // If no delimiter is found, set end to the length of the string
        if (end == string::npos) {
            end = S.length();
        }

        // Extract the sentence
        string sentence = S.substr(start, end - start);

        // Trim leading spaces
        size_t first_non_space = sentence.find_first_not_of(" ");
        if (first_non_space != string::npos) {
            sentence = sentence.substr(first_non_space);
        }

        // Check if the sentence starts with "I"
        if (sentence.rfind("I", 0) == 0) { // rfind checks if "I" is at the start
            count++;
        }

        // Move start to the character after the delimiter
        start = end + 1;
    }

    return count;
}

