// Function to check if a number is prime
bool isPrime(int num) {
    if (num <= 1) return false;
    for (int i = 2; i <= sqrt(num); i++) {
        if (num % i == 0) return false;
    }
    return true;
}

// Function to find the largest prime and return the sum of its digits
int skjkasdkd(vector<int> lst) {
    int largestPrime = -1;

    // Find the largest prime number in the list
    for (int num : lst) {
        if (isPrime(num) && num > largestPrime) {
            largestPrime = num;
        }
    }

    // If no prime number was found, return 0
    if (largestPrime == -1) return 0;

    // Calculate the sum of the digits of the largest prime
    int sumOfDigits = 0;
    while (largestPrime > 0) {
        sumOfDigits += largestPrime % 10; // Add the last digit
        largestPrime /= 10; // Remove the last digit
    }

    return sumOfDigits;
}

