#include <algorithm>
using namespace std;

string encode(string message) {
    string result = "";
    for (char c : message) {
        if (isalpha(c)) { // Check if the character is a letter
            // Swap case
            if (c == 'a') result += 'c';
            else if (c == 'e') result += 'g';
            else if (c == 'i') result += 'k';
            else if (c == 'o') result += 'q';
            else if (c == 'u') result += 'w';
            else if (c == 'A') result += 'C';
            else if (c == 'E') result += 'G';
            else if (c == 'I') result += 'K';
            else if (c == 'O') result += 'Q';
            else if (c == 'U') result += 'W';
            else {
                // Swap case for consonants
                if (islower(c)) result += toupper(c);
                else result += tolower(c);
            }
        } else {
            result += c; // Non-letter characters are added unchanged
        }
    }
    return result;
}

