string encode(string message) {
    string result = "";
    for (char ch : message) {
        if (isalpha(ch)) { // Check if the character is a letter
            // Swap case
            if (islower(ch)) {
                ch = toupper(ch);
            } else {
                ch = tolower(ch);
            }
            // Replace vowels
            switch (ch) {
                case 'a': ch = 'c'; break;
                case 'e': ch = 'g'; break;
                case 'i': ch = 'k'; break;
                case 'o': ch = 'q'; break;
                case 'u': ch = 'w'; break;
