#include <stdio.h>
#include <string>
using namespace std;

int count_upper(string s) {
    int count = 0; // Initialize the count of uppercase vowels
    for (int i = 0; i < s.length(); i += 2) { // Iterate over even indices
        char ch = s[i]; // Get the character at the current index
        // Check if the character is an uppercase vowel
        if (ch == 'A' || ch == 'E' || ch == 'I' || ch == 'O' || ch == 'U') {
            count++; // Increment the count if it is an uppercase vowel
        }
    }
    return count; // Return the final count
}

