#include <stdio.h>
#include <string>
#include <map>
#include <cctype> // for isupper and islower
using namespace std;

bool check_dict_case(map<string, string> dict) {
    // Check if the map is empty
    if (dict.empty()) {
        return false;
    }

    bool allLower = true;
    bool allUpper = true;

    // Iterate through each key in the map
    for (const auto& pair : dict) {
        const string& key = pair.first; // Get the key

        // Check if the key has any uppercase letter
        for (char c : key) {
            if (isupper(c)) {
                allLower = false; // Found an uppercase letter
            }
            if (islower(c)) {
                allUpper = false; // Found a lowercase letter
            }
        }
    }

    // Return true if all keys are either all lower or all upper
    return allLower || allUpper;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (check_dict_case({{"p","pineapple"}, {"b","banana"}}) == true);
    assert (check_dict_case({{"p","pineapple"}, {"A","banana"}, {"B","banana"}}) == false);
    assert (check_dict_case({{"p","pineapple"}, {"5","banana"}, {"a","apple"}}) == false);
    assert (check_dict_case({{"Name","John"}, {"Age","36"}, {"City","Houston"}}) == false);
    assert (check_dict_case({{"STATE","NC"}, {"ZIP","12345"} }) == true  );
    assert (check_dict_case({{"fruit","Orange"}, {"taste","Sweet"} }) == true  );
    assert (check_dict_case({}) == false);
}

