bool check_dict_case(map<string, string> dict) {
    // Check if the map is empty
    if (dict.empty()) {
        return false;
    }

    bool hasLower = false;
    bool hasUpper = false;

    for (const auto& pair : dict) {
        const string& key = pair.first;

        // Check if the key is lowercase
        bool isLower = true;
        bool isUpper = true;

        for (char c : key) {
            if (!islower(c)) {
                isLower = false;
            }
            if (!isupper(c)) {
                isUpper = false;
            }
        }

        // Update the flags based on the current key
        if (isLower) {
            hasLower = true;
        }
        if (isUpper) {
            hasUpper = true;
        }

        // If both lower and upper case keys are found, return false
        if (hasLower && hasUpper) {
            return false;
        }
    }

    // If we only have lower or only upper case keys, return true
    return hasLower || hasUpper;
}

