int choose_num(int x, int y) {
    // Check if the range is valid
    if (y < x) {
        return -1;
    }

    // Determine the largest even number in the range
    int largest_even;
    if (y % 2 == 0) {
        largest_even = y; // y is even
    } else {
        largest_even = y - 1; // y is odd, take y - 1
    }

    // Check if the largest even number is within the range
    if (largest_even < x) {
        return -1; // No even number in the range
    }

    return largest_even; // Return the largest even number
}

