using namespace std;

int closest_integer(string value) {
    double float_value = atof(value.c_str()); // Convert string to double
    int integer_part = floor(float_value); // Get the integer part
    double decimal_part = float_value - integer_part; // Get the decimal part

    if (decimal_part < 0.5) {
        return integer_part; // Round down
    } else if (decimal_part > 0.5) {
        return integer_part + 1; // Round up
    } else {
        // If decimal_part is exactly 0.5
        if (integer_part >= 0) {
            return integer_part + 1; // Round away from zero
        } else {
            return integer_part - 1; // Round away from zero
        }
    }
}

