    vector<string> words;
    string current_word;

    for (char c : s) {
        if (c != ' ' && c != ',') {
            current_word += c; // Build the current word
        } else {
            if (!current_word.empty()) {
                words.push_back(current_word); // Add the word to the vector
                current_word.clear(); // Reset for the next word
            }
        }
    }

    // Check if there's a word left to add after the loop
    if (!current_word.empty()) {
        words.push_back(current_word);
    }

    return words;
