string toBinary(int num) {
    if (num == 0) return "0";
    string binary = "";
    while (num > 0) {
        binary = to_string(num % 2) + binary;
        num /= 2;
    }
    return binary;
}

string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }

    // Calculate the sum from n to m
    int sum = (m * (m + 1) / 2) - ((n - 1) * n / 2);
    // Count of numbers from n to m
    int count = m - n + 1;
    // Calculate the average and round down
    int average = sum / count;

    // Convert the average to binary
    return toBinary(average);
}

