    // Reverse the sorted numbers
    reverse(temp.begin(), temp.end());

    // Prepare the result vector
    vector<string> result;

    // Map numbers to their corresponding words
    for (int number : temp) {
        result.push_back(numToWord[number]);
    }

    return result;
