int count_nums(vector<int> n) {
    int count = 0;

    for (int num : n) {
        int sum = 0;
        int temp = abs(num);
        bool isNegative = (num < 0);

        // Calculate the sum of digits
        while (temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }

        // If the number is negative, adjust the sum
        if (isNegative) {
            sum -= 2 * (num / abs(num)); // Adjust for the first signed digit
        }

        // Count if the sum of digits is greater than zero
        if (sum > 0) {
            count++;
        }
    }

    return count;
}

