    if (day < 1) {
        return false;
    }
    if (month == 2) {
        if (day > 29) {
            return false;
        }
    } else if (month == 4 || month == 6 || month == 9 || month == 11) {
        if (day > 30) {
            return false;
        }
    } else {
        if (day > 31) {
            return false;
        }
    }

    return true;
}

