#include <algorithm>
using namespace std;

vector<int> get_odd_collatz(int n) {
    vector<int> odd_numbers;

    // Generate the Collatz sequence
    while (n != 1) {
        if (n % 2 != 0) { // Check if n is odd
            odd_numbers.push_back(n);
        }
        // Apply the Collatz rules
        if (n % 2 == 0) {
            n = n / 2; // Even case
        } else {
            n = 3 * n + 1; // Odd case
        }
    }

    // Add 1 to the list since the sequence ends with 1
    odd_numbers.push_back(1);

    // Sort the odd numbers
    sort(odd_numbers.begin(), odd_numbers.end());

    return odd_numbers;
}

