bool is_nested(string str) {
    int openCount = 0;
    int closeCount = 0;
    bool nested = false;

    for (char ch : str) {
        if (ch == '[') {
            openCount++;
            if (openCount > 1) {
                nested = true; // We have more than one opening bracket
            }
