void dfs(int x, int y, int k, vector<vector<int>>& grid, vector<int>& currentPath, vector<int>& bestPath) {
    if (currentPath.size() == k) {
        if (bestPath.empty() || currentPath < bestPath) {
            bestPath = currentPath; // Update best path if current is better
        }
        return;
    }

    // Directions for moving in the grid (up, down, left, right)
    vector<pair<int, int>> directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

    for (auto& dir : directions) {
        int newX = x + dir.first;
        int newY = y + dir.second;

        // Check if new coordinates are within bounds
        if (newX >= 0 && newX < grid.size() && newY >= 0 && newY < grid[0].size()) {
            currentPath.push_back(grid[newX][newY]); // Move to the new cell
            dfs(newX, newY, k, grid, currentPath, bestPath); // Recursive DFS
            currentPath.pop_back(); // Backtrack
        }
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<int> bestPath;
    int n = grid.size();

    // Start DFS from each cell in the grid
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> currentPath = {grid[i][j]};
            dfs(i, j, k, grid, currentPath, bestPath);
        }
    }

    return bestPath;
}

