using namespace std;

string fix_spaces(string text) {
    string result = "";
    int spaceCount = 0;

    for (char c : text) {
        if (c == ' ') {
            spaceCount++;
        } else {
            if (spaceCount > 0) {
                if (spaceCount == 1) {
                    result += '_'; // Replace single space with underscore
                } else {
                    result += '-'; // Replace multiple spaces with hyphen
                }
                spaceCount = 0; // Reset space count
            }
            result += c; // Append the current character
        }
    }

    // Handle any trailing spaces at the end of the string
    if (spaceCount > 0) {
        if (spaceCount == 1) {
            result += '_'; // Replace single space with underscore
        } else {
            result += '-'; // Replace multiple spaces with hyphen
        }
    }

    return result;
}

