int sum_squares(vector<int> lst) {
    int sum = 0; // Initialize sum to 0
    for (int i = 0; i < lst.size(); i++) { // Loop through each index
        if (i % 3 == 0) { // Check if index is a multiple of 3
            lst[i] = lst[i] * lst[i]; // Square the element
        } else if (i % 4 == 0) { // Check if index is a multiple of 4
            lst[i] = lst[i] * lst[i] * lst[i]; // Cube the element
        }
        sum += lst[i]; // Add the modified element to sum
    }
    return sum; // Return the total sum
}

