int get_max_triples(int n) {
    vector<int> a(n);
    for (int i = 1; i <= n; i++) {
        a[i - 1] = i * i - i + 1; // Fill the vector using the given formula
    }

    int count0 = 0, count1 = 0, count2 = 0;

    // Count occurrences of each modulo category
    for (int value : a) {
        if (value % 3 == 0) {
            count0++;
        } else if (value % 3 == 1) {
            count1++;
        } else {
            count2++;
        }
    }

    int total_triples = 0;

    // Count combinations of (0, 0, 0)
    if (count0 >= 3) {
        total_triples += (count0 * (count0 - 1) * (count0 - 2)) / 6;
    }

    // Count combinations of (1, 1, 1)
    if (count1 >= 3) {
        total_triples += (count1 * (count1 - 1) * (count1 - 2)) / 6;
    }

    // Count combinations of (2, 2, 2)
    if (count2 >= 3) {
        total_triples += (count2 * (count2 - 1) * (count2 - 2)) / 6;
    }

    // Count combinations of (0, 1, 2)
    total_triples += count0 * count1 * count2;

    return total_triples;
}

