// Helper function to calculate the sum of digits
int digitSum(int num) {
    int sum = 0;
    bool isNegative = num < 0;
    num = abs(num); // Work with positive value for digit extraction

    while (num > 0) {
        sum += num % 10; // Add last digit
        num /= 10; // Remove last digit
    }

    // If the number was negative, we need to account for the first digit
    if (isNegative) {
        sum = -sum; // Make the sum negative
    }

    return sum;
}

vector<int> order_by_points(vector<int> nums) {
    vector<pair<int, int>> indexedNums; // Pair of (digit sum, original index)

    // Populate the vector with digit sums and original indices
    for (int i = 0; i < nums.size(); i++) {
        indexedNums.push_back({digitSum(nums[i]), i});
    }

    // Sort based on digit sum and original index
    sort(indexedNums.begin(), indexedNums.end(), [](const pair<int, int>& a, const pair<int, int>& b) {
        if (a.first == b.first) {
            return a.second < b.second; // Maintain original order if digit sums are equal
        }
        return a.first < b.first; // Sort by digit sum
    });

    // Prepare the result vector
    vector<int> result;
    for (const auto& p : indexedNums) {
        result.push_back(nums[p.second]); // Push the original number based on sorted indices
    }

    return result;
}

