long long double_the_difference(vector<float> lst) {
    long long sum_of_squares = 0; // To hold the sum of squares
    if (lst.empty()) {
        return 0; // Return 0 if the input vector is empty
    }

    for (float number : lst) {
        // Check if the number is a non-negative integer and odd
        if (number >= 0 && floor(number) == number && static_cast<int>(number) % 2 != 0) {
            sum_of_squares += static_cast<int>(number) * static_cast<int>(number); // Add the square of the number
        }
    }

    return sum_of_squares; // Return the final sum
}

