long long double_the_difference(vector<float> lst) {
    long long sum_of_squares = 0; // Initialize sum of squares
    for (float number : lst) {
        // Check if number is a positive integer and odd
        if (number > 0 && floor(number) == number && static_cast<int>(number) % 2 != 0) {
            sum_of_squares += static_cast<int>(number) * static_cast<int>(number); // Square and add to sum
        }
    }
    return sum_of_squares; // Return the final sum
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (double_the_difference({}) == 0);
    assert (double_the_difference({5, 4}) == 25);
    assert (double_the_difference({0.1, 0.2, 0.3}) == 0 );
    assert (double_the_difference({-10, -20, -30}) == 0 );
    assert (double_the_difference({-1, -2, 8}) == 0);
    assert (double_the_difference({0.2, 3, 5}) == 34);


    long long odd_sum=0;
    vector<float> lst={};

    for (int i=-99;i<100;i+=2)
    {
        lst.push_back(i+0.0);
        if (i>0 and i%2==1) odd_sum+=i*i;
    }

    assert (double_the_difference(lst) == odd_sum );
}

