#include <queue>
#include <bits/stdc++.h>

#include <string>
#include <vector>
using namespace std;

string int_to_mini_roman(int number) {
    // Define the Roman numeral mappings
    vector<pair<int, string>> romanMappings = {
        {1000, "m"}, {900, "cm"}, {500, "d"}, {400, "cd"},
        {100, "c"}, {90, "xc"}, {50, "l"}, {40, "xl"},
        {10, "x"}, {9, "ix"}, {5, "v"}, {4, "iv"},
        {1, "i"}
    };

    string result = "";

    // Iterate through the mappings
    for (const auto& mapping : romanMappings) {
        while (number >= mapping.first) {
            result += mapping.second; // Append the Roman numeral
            number -= mapping.first;   // Decrease the number
        }
    }

    return result; // Return the result in lowercase
}

