#include <stdio.h>
#include <string>
#include <cctype> // for isalpha, toupper, tolower
using namespace std;

string solve(string s) {
    string result = "";
    bool hasLetter = false;

    for (char c : s) {
        if (isalpha(c)) {
            hasLetter = true;
            // Reverse case
            if (islower(c)) {
                result += toupper(c);
            } else {
                result += tolower(c);
            }
        } else {
            result += c; // Keep the character as it is
        }
    }

    // If no letters were found, reverse the original string
    if (!hasLetter) {
        reverse(s.begin(), s.end());
        return s;
    }

    return result;
}

