            hasLetter = true;
            // Reverse case
            if (islower(c)) {
                result += toupper(c);
            } else {
                result += tolower(c);
            }
        } else {
            result += c; // Keep non-letter characters as is
        }
    }

    // If no letters were found, reverse the result string
    if (!hasLetter) {
        reverse(result.begin(), result.end());
    }

    return result;
}

