int do_algebra(vector<string> operato, vector<int> operand) {
    if (operand.size() < 2 || operato.size() != operand.size() - 1) {
        throw invalid_argument("Invalid input sizes.");
    }

    // Step 1: Handle exponentiation first
    vector<int> tempOperands;
    vector<string> tempOperators;

    tempOperands.push_back(operand[0]);

    for (size_t i = 0; i < operato.size(); i++) {
        if (operato[i] == "**") {
            int result = pow(tempOperands.back(), operand[i + 1]);
            tempOperands.pop_back();
            tempOperands.push_back(result);
        } else {
            tempOperators.push_back(operato[i]);
            tempOperands.push_back(operand[i + 1]);
        }
    }

    // Step 2: Handle multiplication and floor division
    vector<int> finalOperands;
    vector<string> finalOperators;

    finalOperands.push_back(tempOperands[0]);

    for (size_t i = 0; i < tempOperators.size(); i++) {
        if (tempOperators[i] == "*" || tempOperators[i] == "//") {
            int result = (tempOperators[i] == "*") ? 
                         finalOperands.back() * tempOperands[i + 1] : 
                         finalOperands.back() / tempOperands[i + 1];
            finalOperands.pop_back();
            finalOperands.push_back(result);
        } else {
            finalOperators.push_back(tempOperators[i]);
            finalOperands.push_back(tempOperands[i + 1]);
        }
    }

    // Step 3: Handle addition and subtraction
    int result = finalOperands[0];
    for (size_t i = 0; i < finalOperators.size(); i++) {
        if (finalOperators[i] == "+") {
            result += finalOperands[i + 1];
        } else if (finalOperators[i] == "-") {
            result -= finalOperands[i + 1];
        }
    }

    return result;
}

