int do_algebra(vector<string> operato, vector<int> operand) {
    // Step 1: Handle multiplication and division first
    vector<int> intermediate;
    intermediate.push_back(operand[0]); // Start with the first operand

    for (size_t i = 0; i < operato.size(); i++) {
        if (operato[i] == "*" || operato[i] == "//") {
            int last = intermediate.back();
            int current = operand[i + 1];
            if (operato[i] == "*") {
                intermediate.back() = last * current; // Perform multiplication
            } else if (operato[i] == "//") {
                intermediate.back() = last / current; // Perform floor division
            }
        } else {
            intermediate.push_back(operand[i + 1]); // Push the next operand
            intermediate.push_back(operato[i]); // Push the operator
        }
    }

    // Step 2: Handle addition and subtraction
    int result = intermediate[0]; // Start with the first number
    for (size_t i = 1; i < intermediate.size(); i += 2) {
        string op = intermediate[i]; // Get the operator
        int num = intermediate[i + 1]; // Get the next number
        if (op == "+") {
            result += num; // Perform addition
        } else if (op == "-") {
            result -= num; // Perform subtraction
        }
    }

    return result; // Return the final result
}

