using namespace std;

vector<int> generate_integers(int a, int b) {
    vector<int> result;
    int min_val = min(a, b);
    int max_val = max(a, b);

    // Check even digits from 2 to 8
    for (int even_digit : {2, 4, 6, 8}) {
        if (even_digit >= min_val && even_digit <= max_val) {
            result.push_back(even_digit);
        }
    }

    return result;
}

